import Axios from 'axios';


const host = 'http://localhost:8080';

let fns = {

   async TmList(){

    console.log('开始异步请求数据');

    await Axios({
      method: 'get',
      url: host+'/find',
      params: {
        page: 1,
        size: 10
      }
    }).then(function (response) {

      console.log('异步请求数据结束');
      console.log(response.data);
      return response.data;
    });

   }

}

export default fns;
